import React from 'react';
import './Type.scss'


const Type = (props) => {
  const { fighting, fire, dark } = props;
  return (
    
      <span className={'type'}>
        {fighting}
        {fire}
        {dark}
      </span>

     
      
  );
};

export default Type;
